import React from 'react';
import {getDropDownLinks} from './PageLinks';


const DropDownMenu = ({bool})  => {

    return (
        <div className="dropdown-menu" style={ bool ? {display:"block"} : {display:"none"}}>
            {getDropDownLinks()}
        </div>
    )
}

export default DropDownMenu
